CREATE TABLE IF NOT EXISTS `wishlists` (
  `id` int AUTO_INCREMENT NOT NULL,
  `userId` int NOT NULL,
  `productId` int NOT NULL,
  `createdAt` timestamp NOT NULL DEFAULT (now()),
  CONSTRAINT `wishlists_id` PRIMARY KEY(`id`),
  CONSTRAINT `wishlists_userId_users_id_fk` FOREIGN KEY (`userId`) REFERENCES `users`(`id`),
  CONSTRAINT `wishlists_productId_products_id_fk` FOREIGN KEY (`productId`) REFERENCES `products`(`id`)
);

CREATE INDEX IF NOT EXISTS `user_id_idx` ON `wishlists` (`userId`);
CREATE INDEX IF NOT EXISTS `user_product_idx` ON `wishlists` (`userId`, `productId`);
CREATE UNIQUE INDEX IF NOT EXISTS `unique_user_product` ON `wishlists` (`userId`, `productId`);

